pragma solidity 0.8.4;

// SPDX-License-Identifier: MIT

import './../interfaces/ICompetition.sol';
import './standard/access/AccessControl.sol';
import '../interfaces/IToken.sol';
import '../interfaces/IVault.sol';
import '../interfaces/IRegistry.sol';

/**
 * @title RCI Tournament Contract
 * @author Rocket Capital Investment Pte Ltd
 * @dev This contract manages registration and reward payouts for the RCI Tournament.
 * @dev IPFS hash format: Hash Identifier (2 bytes), Actual Hash (May eventually take on other formats but currently 32 bytes)
 * 
 */
contract Competition is AccessControl, ICompetition {

    struct Challenge{
        bytes32 dataset;
        bytes32 results;
        uint256 totalStakedForChallenge;
        uint8 phase;
        // 0: closed, 1: open for staking, 2: staking closed, open for submissions, 3: submissions closed 4: rewards paid, phase completed.
        mapping(address => bytes32) addressToSubmissionMap;
        address[] submitters;
    }

    IToken private _token;
    IVault private _vault;
    uint32 private _challengeCounter;
    uint256 private _stakeThreshold;
    uint256 private _competitionPool;
    uint256 private _currentTotalStaked;
    uint256 private _currentParticipationRewardsBudget;
    uint256 private _currentPerformanceRewardsBudget;
    uint256 private _performanceRewardsPercentageInWei = 90e16;
    mapping(address => uint256) private _stakes;
    mapping(uint32 => Challenge) private _challenges;

    /*
    * @param duration_ The number of phases per challenge.
    * @param fee_ The initial registration fee in Token wei.
    * @param token_address_ The address of the ERC20 token contract.
    */
    constructor(uint256 stakeThreshold_, address tokenAddress_, address vaultAddress_){
        require(tokenAddress_ != address(0), "No token address found.");
        require(vaultAddress_ != address(0), "No vault address found.");

        _setupRole(DEFAULT_ADMIN_ROLE, msg.sender);
        _stakeThreshold = stakeThreshold_;
        _token = IToken(tokenAddress_);
        _vault = IVault(vaultAddress_);
        _challengeCounter = 0;
        _challenges[_challengeCounter].phase = 4;
    }

    function sponsor(uint256 amountToken)
    external override
    returns (bool success)
    {
        // Transfer would fail anyway if not approved.
        require(_token.transferFrom(msg.sender, address(this), amountToken), "Tournament - sponsor: Token transfer failed.");
        uint256 currentCompPoolAmt = _competitionPool;
        _competitionPool = currentCompPoolAmt + amountToken;
        success = true;

        emit Sponsor(msg.sender, amountToken, currentCompPoolAmt + amountToken);
    }

    function setStake(uint256 amountToken)
    external override
    returns (bool success)
    {
        uint256 currentStake = _stakes[msg.sender];
        require(currentStake != amountToken, "Competition - setStake: Your stake is already set to this amount.");
        if (amountToken > currentStake){
            require(increaseStake(amountToken - currentStake), "Competition - setStake: Could not increase stake.");
        } else{
            require(decreaseStake(currentStake - amountToken), "Competition - setStake: Could not decrease stake.");
        }
        success = true;
    }

    function increaseStake(uint256 amountToken)
    public override
    returns (bool success)
    {
        require(_challenges[_challengeCounter].phase == 1, "Competition - increaseStake: Please wait for the staking period to unlock before modifying your stake.");
        require(_token.transferFrom(msg.sender, address(this), amountToken), "Competition - increaseStake: Token Transfer failed.");
        _stakes[msg.sender] += amountToken;
        _currentTotalStaked += amountToken;
        success = true;

        emit StakeIncreased(msg.sender, amountToken);
    }

    function decreaseStake(uint256 amountToken)
    public override
    returns (bool success)
    {
        require(_challenges[_challengeCounter].phase == 1, "Competition - decreaseStake: Please wait for the staking period to unlock before modifying your stake.");
        uint256 currentBal = _stakes[msg.sender];
        require(amountToken <= currentBal, "Competition - decreaseStake: Insufficient funds for withdrawal.");
        _stakes[msg.sender] = currentBal - amountToken;
        _currentTotalStaked -= amountToken;
        _token.transfer(msg.sender, amountToken);
        success = true;

        emit StakeDecreased(msg.sender, amountToken);
    }

    function transferStake(address recipient, uint256 amountToken)
    external override
    returns (bool success)
    {
        require(_challenges[_challengeCounter].phase == 1, "Competition - transferStake: Please wait for the staking period to unlock before modifying your stake.");
        uint256 currentBal = _stakes[msg.sender];
        require(amountToken <= currentBal, "Competition - transferStake: Insufficient balance.");
        _stakes[msg.sender] -= amountToken;
        _stakes[recipient] += amountToken;
        success = true;

        emit StakeTransferred(msg.sender, recipient, amountToken);
    }

    function submitNewPredictions(bytes32 submissionHash)
    external override
    returns (uint32 challengeNumber)
    {  
        challengeNumber = _updateSubmission(bytes32(0), submissionHash);
        uint256 currentStake = _stakes[msg.sender];
        require(currentStake >= _stakeThreshold, "Competition - submitNewPredictions: Stake is below threshold.");
        _challenges[challengeNumber].submitters.push(msg.sender);

        uint256 participationRewards = _currentParticipationRewardsBudget * currentStake / _challenges[challengeNumber].totalStakedForChallenge;

        _competitionPool -= participationRewards;
        _stakes[msg.sender] = currentStake + participationRewards;
        _currentTotalStaked += participationRewards;

        emit StakeParticipationRewardsPaid(msg.sender, currentStake, participationRewards);
    }

    function updateSubmission(bytes32 oldSubmissionHash, bytes32 newSubmissionHash)
    public override
    returns (uint32 challengeNumber)
    {
        require(oldSubmissionHash != bytes32(0), "Competition - updateSubmission: Must have pre-existing submission.");
        challengeNumber = _updateSubmission(oldSubmissionHash, newSubmissionHash);
    }

    function _updateSubmission(bytes32 oldSubmissionHash, bytes32 newSubmissionHash)
    private
    returns (uint32 challengeNumber)
    {
        challengeNumber = _challengeCounter;
        require(_challenges[challengeNumber].phase == 2, "Competition - updateSubmission: Not available for submissions.");
        require(newSubmissionHash != bytes32(0), "Competition - updateSubmission: Cannot submit empty hash.");
        require(oldSubmissionHash != newSubmissionHash, "Competition - updateSubmission: Cannot update with the same hash as before.");
        require(_challenges[challengeNumber].addressToSubmissionMap[msg.sender] == oldSubmissionHash,
                "Competition - updateSubmission: Clash in existing submission hash.");
        _challenges[challengeNumber].addressToSubmissionMap[msg.sender] = newSubmissionHash;

        emit SubmissionUpdated(challengeNumber, msg.sender, newSubmissionHash);
    }

    function getCompetitionPool()
    view external override
    returns (uint256 competitionPool)
    {
        competitionPool = _competitionPool;
    }

    function getCurrentTotalStaked()
    view external override
    returns (uint256 currentTotalStaked)
    {
        currentTotalStaked = _currentTotalStaked;
    }

    function getCurrentParticipationRewardsBudget()
    view external override
    returns (uint256 currentParticipationRewardsBudget)
    {
        currentParticipationRewardsBudget = _currentParticipationRewardsBudget;
    }

    function getCurrentPerformanceRewardsBudget()
    view external override
    returns (uint256 currentPerformanceRewardsBudget)
    {
        currentPerformanceRewardsBudget = _currentPerformanceRewardsBudget;
    }

    function getLatestChallengeNumber()
    view public override
    returns (uint32 latestChallengeNumber)
    {
        latestChallengeNumber = _challengeCounter;
    }

    function getDatasetHash(uint32 challengeNumber)
    view external override
    returns (bytes32 dataset)
    {
        dataset = _challenges[challengeNumber].dataset;
    }

    function getResultsHash(uint32 challengeNumber)
    view external override
    returns (bytes32 results)
    {
        results = _challenges[challengeNumber].results;
    }

    function getSubmissionCounter(uint32 challengeNumber)
    view external override
    returns (uint256 submissionCounter)
    {
        submissionCounter = _challenges[challengeNumber].submitters.length;
    }

    function getSubmitters(uint32 challengeNumber)
    view external override
    returns (address[] memory submitters)
    {
        submitters = _challenges[challengeNumber].submitters;
    }

    function getPhase(uint32 challengeNumber)
    view external override
    returns (uint8 phase)
    {
        phase = _challenges[challengeNumber].phase;
    }

    function getStakeThreshold()
    view external override
    returns (uint256 stakeThreshold)
    {
        stakeThreshold = _stakeThreshold;
    }

    function getStake(address participant)
    view external override
    returns (uint256 stake)
    {
        stake = _stakes[participant];
    }

    function getTokenAddress()
    view external override
    returns (address tokenAddress)
    {
        tokenAddress = address(_token);
    }

    function getVaultAddress()
    view external override
    returns (address vaultAddress)
    {
        vaultAddress = address(_vault);
    }

    function getSubmission(uint32 challengeNumber, address participant)
    view external override
    returns (bytes32 submissionHash)
    {
        submissionHash = _challenges[challengeNumber].addressToSubmissionMap[participant];
    }

    function getTotalStakesLockedForChallenge(uint32 challengeNumber)
    view external override
    returns (uint256 totalStakedForChallenge)
    {
        totalStakedForChallenge = _challenges[challengeNumber].totalStakedForChallenge;
    }

    function updateVaultAddress(address newVaultAddress)
    external override
    {
        require(hasRole(DEFAULT_ADMIN_ROLE, msg.sender), "Competition - updateVaultAddress: Caller is unauthorized.");
        _vault = IVault(newVaultAddress);

        emit VaultAddressUpdated(newVaultAddress);
    }

    function updateStakeThreshold(uint256 newStakeThreshold)
    external override
    {
        require(hasRole(DEFAULT_ADMIN_ROLE, msg.sender), "Competition - updateStakeThreshold: Caller is unauthorized.");
        _stakeThreshold = newStakeThreshold;

        emit StakeThresholdUpdated(newStakeThreshold, msg.sender);
    }

    function openStaking(bytes32 datasetHash)
    external override
    {
        require(hasRole(DEFAULT_ADMIN_ROLE, msg.sender), "Competition - openStaking: Caller is unauthorized.");
        uint32 challengeNumber = _challengeCounter;
        require(_challenges[challengeNumber].phase == 4, "Competition - openStaking: Previous phase is incomplete.");

        challengeNumber++;

        _challenges[challengeNumber].phase = 1;
        _challengeCounter = challengeNumber;

        _updateDataset(challengeNumber, bytes32(0), datasetHash);

        uint256 drawAmount = _vault.draw();
        _competitionPool += drawAmount;

        _currentPerformanceRewardsBudget = _competitionPool * _performanceRewardsPercentageInWei/(1e18);
        _currentParticipationRewardsBudget = _competitionPool - _currentPerformanceRewardsBudget;

        emit StakingOpened(challengeNumber);
    }

    function openSubmission()
    external override
    {
        require(hasRole(DEFAULT_ADMIN_ROLE, msg.sender), "Competition - openSubmission: Caller is unauthorized.");
        uint32 challengeNumber = _challengeCounter;
        require(_challenges[challengeNumber].phase == 1, "Competition - openSubmission: Challenge is in unexpected state.");

        _challenges[challengeNumber].phase = 2;
        _challenges[challengeNumber].totalStakedForChallenge = _currentTotalStaked;

        emit SubmissionOpened(challengeNumber);
    }

    function updateDataset(bytes32 oldDatasetHash, bytes32 newDatasetHash)
    external override
    {
        require(hasRole(DEFAULT_ADMIN_ROLE, msg.sender), "Competition - updateDataset: Caller is unauthorized.");
        uint32 challengeNumber = _challengeCounter;
        require(_challenges[challengeNumber].phase == 1, "Competition - updateDataset: Challenge is closed.");
        require(oldDatasetHash != bytes32(0), "Competition - updateDataset: Must have pre-existing dataset.");
        _updateDataset(challengeNumber, oldDatasetHash, newDatasetHash);
    }

    function _updateDataset(uint32 challengeNumber, bytes32 oldDatasetHash, bytes32 newDatasetHash)
    private
    {
        require(oldDatasetHash != newDatasetHash, "Competition - updateDataset: Cannot update with the same hash as before.");
        require(_challenges[challengeNumber].dataset == oldDatasetHash, "Competition - updateDataset: Incorrect old dataset reference.");
        _challenges[challengeNumber].dataset = newDatasetHash;

        emit DatasetUpdated(challengeNumber, oldDatasetHash, newDatasetHash);
    }

    function closeSubmission()
    external override
    {
        require(hasRole(DEFAULT_ADMIN_ROLE, msg.sender), "Competition - closeSubmission: Caller is unauthorized.");
        uint32 challengeNumber = _challengeCounter;
        require(_challenges[challengeNumber].phase == 2, "Competition - closeSubmission: Challenge in unexpected state.");
        _challenges[challengeNumber].phase = 3;

        emit SubmissionClosed(challengeNumber);
    }

    function submitResults(bytes32 resultsHash)
    external override
    {
        _updateResults(bytes32(0), resultsHash);
    }

    function updateResults(bytes32 oldResultsHash, bytes32 newResultsHash)
    public override
    {

        require(oldResultsHash != bytes32(0), "Competition - updateResults: Must have pre-existing results.");
        _updateResults(oldResultsHash, newResultsHash);
    }

    function _updateResults(bytes32 oldResultsHash, bytes32 newResultsHash)
    private
    {
        require(hasRole(DEFAULT_ADMIN_ROLE, msg.sender), "Competition - updateResults: Caller is unauthorized.");
        require(oldResultsHash != newResultsHash, "Competition - updateResults: Cannot update with the same hash as before.");
        uint32 challengeNumber = _challengeCounter;
        require(_challenges[challengeNumber].phase >= 3, "Competition - updateResults: Challenge in unexpected state.");
        require(_challenges[challengeNumber].results == oldResultsHash, "Competition - updateResults: Clash in existing results hash.");
        _challenges[challengeNumber].results = newResultsHash;

        emit ResultsUpdated(challengeNumber, oldResultsHash, newResultsHash);
    }

    function payPerformanceRewards(address[] calldata winners, uint256[] calldata rewards)
    external override
    returns (bool success)
    {
        success = payPerformanceRewards(_challengeCounter, winners, rewards);
    }

    function payPerformanceRewards(uint32 challengeNumber, address[] calldata winners, uint256[] calldata rewards)
    public override
    returns (bool success)
    {
        require(hasRole(DEFAULT_ADMIN_ROLE, msg.sender), "Competition - payPerformanceRewards: Caller is unauthorized.");
        require(_challenges[challengeNumber].phase >= 3, "Competition - payPerformanceRewards: Challenge is in unexpected state.");
        require(winners.length == rewards.length, "Competition - payPerformanceRewards: Number of winners and rewards are different.");
        uint256 totalAmount;
        for (uint i = 0; i < winners.length; i++)
        {
            uint256 rewardAmount = rewards[i];
            address winner = winners[i];
            _stakes[winner] += rewardAmount;
            totalAmount += rewardAmount;
            emit PerformanceRewardsPayment(winner, rewardAmount);
        }
        if (totalAmount > _currentPerformanceRewardsBudget) {
            revert('Total payout sum more than competition pool.');
        }
        else {
            _competitionPool -= totalAmount;
            _currentTotalStaked += totalAmount;
            success = true;
        }
        _challenges[challengeNumber].phase = 4;

        emit PerformanceRewardsPaid(challengeNumber, totalAmount);
    }
}
